import Homepage from "./pages/Homepage";
import Stage1 from "./pages/Stage1";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/about" element={<Stage1 />} />
      </Routes>
    </Router>
  );
}

export default App;
